								FROM prinumbers pri
								LEFT JOIN 1_groups g on (g.prinumber=pri.number AND g.gid=pri.associateid AND g.status=1)
								LEFT JOIN 1_ivrs i on (i.prinumber=pri.number AND i.ivrsid=pri.associateid AND i.status=1)
